(931, 21, 'level_m', 'In a computer system, four files of size 11050 bytes, 4990 bytes, 5170 bytes and 12640 bytes need to be stored. For storing these files on disk, we can use either 100 byte disk blocks or 200 byte disk blocks (but cant mix block sizes). For each block used to store a file, 4 bytes of bookkeeping information also needs to be stored on the disk. Thus,the total space used to store a file is the sum of the space taken to store the file and the space taken to store the bookkeeping information for the blocks allocated for storing the file. A disk block can store either bookkeeping information for a file or data from a file, but not both. What is the total space required for storing the files using 100 byte disk blocks and 200 byte disk blocks respectively?', NULL, '35400 and 35800 bytes', '35800 and 35400 bytes', '35600 and 35400 bytes', '35400 and 35600 bytes', '', 'optionc', 'MC'),
(932, 21, 'level_m', 'A company maintains records of sales made by its salespersons and pays them commission based on each individuals total sales made in a year. This data is maintained in a table with following schema:\r\nsalesinfo = (salespersonid, totalsales, commission)\r\nIn a certain year, due to better business results, the company decides to further reward its salespersons by enhancing the commission paid to them as per the following formula.\r\nIf commission &lt; = 50000, enhance it by 2%\r\nIf 50000 &lt; commission &lt; = 100000, enhance it by 4%\r\nIf commission &gt; 100000, enhance it by 6%\r\nThe IT staff has written three different SQL scripts to calculate enhancement for each slab, each of these scripts is to run as a separate transaction as follows:\r\nT1 Update salesinfo\r\nSet commission = commission * 1.02\r\nWhere commission &lt; = 50000;\r\nT2 Update salesinfo\r\nSet commission = commission * 1.04\r\nWhere commission &gt; 50000 and commission is &lt;= 100000;\r\nT3 Update salesinfo\r\nSet commission = commission * 1.06\r\nWhere commission &gt; 100000;\r\nWhich of the following options of running these transactions will update the commission of all salespersons correctly?\r\n', NULL, 'Execute T1 followed by T2 followed by T3', 'Execute T2, followed by T3; T1 running concurrently throughout', 'Execute T3 followed by T2; T1 running concurrently throughout', 'Execute T3 followed by T2 followed by T1', '', 'optiond', 'MC'),
